  public function testAuthenticationLogin()
  {
    $authenticationUrl = $GLOBALS['url'] . "auth/token";

    $headers = array(
      "Accept: application/json",
      "Content-Type:application/json;charset=UTF-8"
    );

    $data = <<<DATA
{
  "username":"izibiz-dev",
  "password":"izi321"
}
DATA;
    $resp = $GLOBALS['operations']->httpRequest($authenticationUrl, $headers, $data, "POST");
    $json = json_decode($resp);
    $data = $json->data;

    $GLOBALS['accesstoken'] = $data->{'accessToken'};
    //print_r($GLOBALS['accesstoken']);
  }

  public function testECheckList()
  {
    $eCheckListUrl = $GLOBALS['url'] . "echecks";
    $headers=$GLOBALS['operations']->header($GLOBALS['accesstoken']);

    $resp = $GLOBALS['operations']->httpRequest($eCheckListUrl, $headers, null, "GET");
    $json = json_decode($resp);
    $data = $json->data;

    $contents = $data->contents;
    $GLOBALS['path'] = $GLOBALS['operations']->homeFileOpen();
    file_put_contents($GLOBALS['path']  . "\\eCheckList.xml", json_encode((array)$data->contents));
    $GLOBALS['eCheckid'] = [];
    $GLOBALS['eCheck'] = [];
    foreach ($contents as $value) {
      array_push($GLOBALS['eCheckid'], $value->id);
      array_push($GLOBALS['eCheck'], $value);
    }
  }

  public function testECheckHtml()
  {

    $eCheckHtmlUrl = $GLOBALS['url'] . "echecks/" . $GLOBALS['eCheckid'][0] . "/preview/html";
    $headers = array(
      'Accept: */*',
      "Content-Type:application/html",
      'Authorization:Bearer ' . $GLOBALS['accesstoken']
    );
    $he = json_encode($headers);
    $resp = $GLOBALS['operations']->httpRequest($eCheckHtmlUrl, $headers, null, "GET");
    $GLOBALS['documentno'] = $GLOBALS['eCheck'][0]->{'documentNo'};
    file_put_contents($GLOBALS['path']  . "\\" . $GLOBALS['documentno'] . ".html", $resp);
  }

