  public function testECheckDownloadUbl()
  {

    $eCheckStatusUrl = $GLOBALS['url'] . "echecks/download/ubl";
    $data = [[
      'id' => $GLOBALS['eCheckid'][1]
    ]];
    $headers=$GLOBALS['operations']->header($GLOBALS['accesstoken']);
    $resp = $GLOBALS['operations']->httpRequest($eCheckStatusUrl, $headers, json_encode($data),"POST");
    $jsonRespose = json_decode($resp);
    $this->assertNotNull($jsonRespose);
    $data = $jsonRespose->data;
    $filename = $data->filename;
    $content = $data->content;
    file_put_contents($GLOBALS['path'] . "\\" . $filename, base64_decode($content));
    $GLOBALS['operations']->decompress($GLOBALS['path'] . "\\" . $filename,$GLOBALS['path'] . "\\");
  }

